import React, { Component } from 'react';
import Item from './Item';

class ArrayTest extends Component {
    constructor(props) {
        super(props);
        this.state = {
            cart: [],
            shop: [
                {exerciseID: 12, username: 'Lars Vermeer', weight: 50},
                {exerciseID: 12, username: 'Roy de Bie', weight: 40},
                {exerciseID: 12, username: 'Joep van Antwerpen', weight: 45},
            ]
        }
    }

    render () {
        return (
            <div>
                <h3>Items for sale</h3>
                {this.state.shop.map((item, key) => 
                    <Item item={item} key={key} />
                )}
            </div>
        )
    }
}

export default ArrayTest;
